  const [posts , setPosts] = useState([]) ; 
  return (
    <div className="feed">
      <div className="feedWrapper">
        <Share/>
        {/* {Posts.map(p => (
          <Post key={p.id} post = {p}/>
        ))} */}
      </div>
    </div>
  )
}

export default Feed
